	  '**Custom Date and Time Formats**\n\nYou can specify custom formats which will be used when rendering dates and times of day. Examples:\n\n| Format  | Example  | Notes |\n| ------  | -------- | ----- |\n| `g:i A` | 2:34 PM  | Default 12-hour time. |\n| `G.i a` | 02.34 pm | Alternate 12-hour time. |\n| `H:i`   | 14:34    | 24-hour time. |\n\n\nYou can find a [[%s | full reference in the PHP manual]].' => '**Custom Date and Time Formats**\n\nYou can specify custom formats which will be used when rendering dates and times of day. Examples:\n\n| Format  | Example  | Notes |\n| ------  | -------- | ----- |\n| `g:i A` | 2:34 PM  | Default 12-hour time. |\n| `G.i a` | 02.34 pm | Alternate 12-hour time. |\n| `H:i`   | 14:34    | 24-hour time. |\n\n\nYou can find a [[%s | full reference in the PHP manual]].',

	  // src/applications/settings/panel/PhabricatorSettingsPanelDeveloperPreferences.php:46
	  '**DarkConsole** is a developer console which can help build and debug Phabricator applications. It includes tools for understanding errors, performance, service calls, and other low-level aspects of Phabricator\'s inner workings.' => '**DarkConsole** is a developer console which can help build and debug Phabricator applications. It includes tools for understanding errors, performance, service calls, and other low-level aspects of Phabricator\'s inner workings.',

	  // src/applications/auth/provider/PhabricatorJIRAAuthProvider.php:195
	  '**JIRA Instance Name**\n\nChoose a permanent name for this instance of JIRA. Phabricator uses this name internally to keep track of this instance of JIRA, in case the URL changes later.\n\nUse lowercase letters, digits, and period. For example, `jira`, `jira.mycompany` or `jira.engineering` are reasonable names.' => '**JIRA Instance Name**\n\nChoose a permanent name for this instance of JIRA. Phabricator uses this name internally to keep track of this instance of JIRA, in case the URL changes later.\n\nUse lowercase letters, digits, and period. For example, `jira`, `jira.mycompany` or `jira.engineering` are reasonable names.',

	  // src/applications/legalpad/application/PhabricatorLegalpadApplication.php:41
	  '**Legalpad** is a simple application for tracking signatures and legal agreements. At the moment, it is primarily intended to help open source projects keep track of Contributor License Agreements.' => '**Legalpad** is a simple application for tracking signatures and legal agreements. At the moment, it is primarily intended to help open source projects keep track of Contributor License Agreements.',

	  // src/applications/auth/provider/PhabricatorJIRAAuthProvider.php:24
	  '**Step 1 of 2**: Provide the name and URI for your JIRA install.\n\nIn the next step, you will configure JIRA.' => '**Step 1 of 2**: Provide the name and URI for your JIRA install.\n\nIn the next step, you will configure JIRA.',

	  // src/applications/auth/provider/PhabricatorJIRAAuthProvider.php:29
	  '**Step 2 of 2**: In this step, you will configure JIRA.\n\n**Create a JIRA Application**: Log into JIRA and go to **Administration**, then **Add-ons**, then **Application Links**. Click the button labeled **Add Application Link**, and use these settings to create an application:\n\n  - **Server URL**: `%s`\n  - Then, click **Next**. On the second page:\n  - **Application Name**: `Phabricator`\n  - **Application Type**: `Generic Application`\n  - Then, click **Create**.\n\n**Configure Your Application**: Find the application you just created in the table, and click the **Configure** link under **Actions**. Select **Incoming Authentication** and click the **OAuth** tab (it may be selected by default). Then, use these settings:\n\n  - **Consumer Key**: Set this to the "Consumer Key" value in the form above.\n  - **Consumer Name**: `Phabricator`\n  - **Public Key**: Set this to the "Public Key" value in the form above.\n  - **Consumer Callback URL**: `%s`\nClick **Save** in JIRA. Authentication should now be configured, and this provider should work correctly.' => '**Step 2 of 2**: In this step, you will configure JIRA.\n\n**Create a JIRA Application**: Log into JIRA and go to **Administration**, then **Add-ons**, then **Application Links**. Click the button labeled **Add Application Link**, and use these settings to create an application:\n\n  - **Server URL**: `%s`\n  - Then, click **Next**. On the second page:\n  - **Application Name**: `Phabricator`\n  - **Application Type**: `Generic Application`\n  - Then, click **Create**.\n\n**Configure Your Application**: Find the application you just 创建了 in the table, and click the **Configure** link under **Actions**. Select **Incoming Authentication** and click the **OAuth** tab (it may be selected by default). Then, use these settings:\n\n  - **Consumer Key**: Set this to the "Consumer Key" value in the form above.\n  - **Consumer Name**: `Phabricator`\n  - **Public Key**: Set this to the "Public Key" value in the form above.\n  - **Consumer Callback URL**: `%s`\nClick **Save** in JIRA. Authentication should now be configured, and this provider should work correctly.',

	  // src/applications/config/controller/PhabricatorConfigWelcomeController.php:34
	  '**Welcome to Phabricator!**\n\nYou have successfully installed Phabricator. This screen will guide you through configuration and orientation.\n\nThese steps are optional, and you can go through them in any order.\n\nIf you want to get back to this screen later on, you can find it in the **Config** application under **Welcome Screen**.' => '**Welcome to Phabricator!**\n\nYou have successfully installed Phabricator. This screen will guide you through configuration and orientation.\n\nThese steps are optional, and you can go through them in any order.\n\nIf you want to get back to this screen later on, you can find it in the **Config** application under **Welcome Screen**.',

	  // src/applications/people/controller/PhabricatorPeopleNewController.php:181
	  '**Why do bot/script accounts need an email address?**\n\nAlthough bots do not normally receive email from Phabricator, they can interact with other systems which require an email address. Examples include:\n\n  - If the account takes actions which //send// email, we need     an address to use in the //From// header.\n  - If the account creates commits, Git and Mercurial require     an email address for authorship.\n  - If you send email //to// Phabricator on behalf of the     account, the address can identify the sender.\n  - Some internal authentication functions depend on accounts     having an email address.\n\n\nThe address will automatically be verified, so you do not need to be able to receive mail at this address, and can enter some invalid or nonexistent (but correctly formatted) address like `bot@yourcompany.com` if you prefer.' => '**Why do bot/script accounts need an email address?**\n\nAlthough bots do not normally receive email from Phabricator, they can interact with other systems which require an email address. Examples include:\n\n  - If the account takes actions which //send// email, we need     an address to use in the //From// header.\n  - If the account creates commits, Git and Mercurial require     an email address for authorship.\n  - If you send email //to// Phabricator on behalf of the     account, the address can identify the sender.\n  - Some internal authentication functions depend on accounts     having an email address.\n\n\nThe address will automatically be verified, so you do not need to be able to receive mail at this address, and can enter some invalid or nonexistent (but correctly formatted) address like `bot@yourcompany.com` if you prefer.',

