il you do, they will continue operating with the old settings.\n\n(If you plan to make more changes, you can restart the daemons once after you finish making all of your changes.)\n\nUse %s to restart daemons. You can find a list of running daemons in the %s, which will also help you identify which daemon (or daemons) have divergent configuration. For more information about managing the daemons, see %s in the documentation.\n\nThis can also happen if you use the %s environmental variable to choose a configuration file, but the daemons run with a different value than the web application. If restarting the daemons does not resolve this issue and you use %s to select configuration, check that it is set consistently.\n\nA third possible cause is that you run several machines, and the %s configuration file differs between them. This file is 更新了 when you edit configuration from the CLI with %s. If restarting the daemons does not resolve this issue and you run multiple machines, check that all machines have identical %s configuration files.\n\nThis issue is not severe, but usually indicates that something is not configured the way you expect, and may cause the daemons to exhibit different behavior than the web application does.',

