	  // src/applications/config/option/PhabricatorSecurityConfigOptions.php:23
	  'IMPORTANT: By default, Phabricator serves files from the same domain the application lives on. This is convenient but not secure: it creates a large class of vulnerabilities which can not be generally mitigated.\n\nTo avoid this, you should configure a second domain in the same way you have the primary domain configured (i.e., point it at the same machine and set up the same vhost rules) and provide it here. For instance, if your primary install is on \'http://www.phabricator-example.com/\', you could configure \'http://www.phabricator-files.com/\' and specify the entire domain (with protocol) here. This will enforce that files are served only from the alternate domain. Ideally, you should use a completely separate domain name rather than just a different subdomain.\n\nIt is **STRONGLY RECOMMENDED** that you configure this. Your install is **NOT SECURE** unless you do so.' => 'IMPORTANT: By default, Phabricator serves files from the same domain the application lives on. This is convenient but not secure: it creates a large class of vulnerabilities which can not be generally mitigated.\n\nTo avoid this, you should configure a second domain in the same way you have the primary domain configured (i.e., point it at the same machine and set up the same vhost rules) and provide it here. For instance, if your primary install is on \'http://www.phabricator-example.com/\', you could configure \'http://www.phabricator-files.com/\' and specify the entire domain (with protocol) here. This will enforce that files are served only from the alternate domain. Ideally, you should use a completely separate domain name rather than just a different subdomain.\n\nIt is **STRONGLY RECOMMENDED** that you configure this. Your install is **NOT SECURE** unless you do so.',

