	  // src/applications/differential/config/PhabricatorDifferentialConfigOptions.php:202
	  'Normally, Differential revisions remain on the dashboard when they are "Accepted", and the author then commits the changes to "Close" the revision and move it off the dashboard.\n\nIf you have an unusual workflow where Differential is used for post-commit review (normally called "Audit", elsewhere in Phabricator), you can set this flag to treat the "Accepted" state as a "Closed" state and end the review workflow early.\n\nThis sort of workflow is very unusual. Very few installs should need to change this option.' => 'Normally, Differential revisions remain on the dashboard when they are "Accepted", and the author then commits the changes to "Close" the revision and move it off the dashboard.\n\nIf you have an unusual workflow where Differential is used for post-commit review (normally called "Audit", elsewhere in Phabricator), you can set this flag to treat the "Accepted" state as a "Closed" state and end the review workflow early.\n\nThis sort of workflow is very unusual. Very few installs should need to change this option.',

	  // src/applications/diffusion/controller/DiffusionRepositoryEditUpdateController.php:55
	  'Normally, Phabricator automatically updates repositories based on how much time has elapsed since the last commit. This helps reduce load if you have a large number of mostly inactive repositories, which is common.' => 'Normally, Phabricator automatically updates repositories based on how much time has elapsed since the last commit. This helps reduce load if you have a large number of mostly inactive repositories, which is common.',

	  // src/applications/config/option/PhabricatorDeveloperConfigOptions.php:85
	  'Normally, Phabricator issues HTTP redirects after a successful POST. This can make it difficult to debug things which happen while processing the POST, because service and profiling information are lost. By setting this configuration option, Phabricator will show a page instead of automatically redirecting, allowing you to examine service and profiling information. It also makes the UX awful, so you should only enable it when debugging.' => 'Normally, Phabricator issues HTTP redirects after a successful POST. This can make it difficult to debug things which happen while processing the POST, because service and profiling information are lost. By setting this configuration option, Phabricator will show a page instead of automatically redirecting, allowing you to examine service and profiling information. It also makes the UX awful, so you should only enable it when debugging.',

	  // src/applications/config/option/PhabricatorDeveloperConfigOptions.php:100
	  'Normally, Phabricator profiles pages only when explicitly requested via DarkConsole. However, it may be useful to profile some pages automatically.\n\nSet this option to a positive integer N to profile 1 / N pages automatically. For example, setting it to 1 will profile every page, while setting it to 1000 will profile 1 page per 1000 requests (i.e., 0.1%% of requests).\n\nSince profiling is slow and generates a lot of data, you should set this to 0 in production (to disable it) or to a large number (to collect a few samples, if you\'re interested in having some data to look at eventually). In development, it may be useful to set it to 1 in order to debug performance problems.\n\nNOTE: You must install XHProf for profiling to work.' => 'Normally, Phabricator profiles pages only when explicitly requested via DarkConsole. However, it may be useful to profile some pages automatically.\n\nSet this option to a positive integer N to profile 1 / N pages automatically. For example, setting it to 1 will profile every page, while setting it to 1000 will profile 1 page per 1000 requests (i.e., 0.1%% of requests).\n\nSince profiling is slow and generates a lot of data, you should set this to 0 in production (to disable it) or to a large number (to collect a few samples, if you\'re interested in having some data to look at eventually). In development, it may be useful to set it to 1 in order to debug performance problems.\n\nNOTE: You must install XHProf for profiling to work.',

	  // src/applications/diffusion/controller/DiffusionRepositoryEditActionsController.php:75
	  'Normally, Phabricator publishes notifications when it discovers new commits. You can disable publishing for this repository by turning off **Notify/Publish**. This will disable notifications, feed, and Herald (including audits and build plans) for this repository.\n\nWhen Phabricator discovers a new commit, it can automatically close associated revisions and tasks. If you don\'t want Phabricator to close objects when it discovers new commits in this repository, you can disable **Autoclose**.' => 'Normally, Phabricator publishes notifications when it discovers new commits. You can disable publishing for this repository by turning off **Notify/Publish**. This will disable notifications, feed, and Herald (including audits and build plans) for this repository.\n\nWhen Phabricator discovers a new commit, it can automatically close associated revisions and tasks. If you don\'t want Phabricator to close objects when it discovers new commits in this repository, you can disable **Autoclose**.',

	  // src/applications/differential/config/PhabricatorDifferentialConfigOptions.php:294
	  'Normally, inline comments in emails are shown with a file and line but without any diff context. Enabling this option adds diff context and the comment thread.' => 'Normally, inline comments in emails are shown with a file and line but without any diff context. Enabling this option adds diff context and the comment thread.',

	  // src/applications/differential/config/PhabricatorDifferentialConfigOptions.php:131
	  'Normally, when revisions that have been "Accepted" are updated, they remain "Accepted". This allows reviewers to suggest minor alterations when accepting, and encourages authors to update if they make minor changes in response to this feedback.\n\nIf you want updates to always require re-review, you can disable the "stickiness" of the "Accepted" status with this option. This may make the process for minor changes much more burdensome to both authors and reviewers.' => 'Normally, when revisions that have been "Accepted" are 更新了, they remain "Accepted". This allows reviewers to suggest minor alterations when accepting, and encourages authors to update if they make minor changes in response to this feedback.\n\nIf you want updates to always require re-review, you can disable the "stickiness" of the "Accepted" status with this option. This may make the process for minor changes much more burdensome to both authors and reviewers.',

