	  // src/applications/config/controller/PhabricatorConfigWelcomeController.php:197
	  'Phabricator is a large suite of applications that work together to help you develop software, manage tasks, and communicate. A few of the most commonly used applications are pinned to the left navigation bar by default.\n\nTo explore all of the Phabricator applications, adjust settings, or uninstall applications you don\'t plan to use, visit the **[[ %s | Applications Application ]]**. You can also click the **Applications** button in the left navigation menu, or search for an application by name in the main menu bar.\n\n' => 'Phabricator is a large suite of applications that work together to help you develop software, manage tasks, and communicate. A few of the most commonly used applications are pinned to the left navigation bar by default.\n\nTo explore all of the Phabricator applications, adjust settings, or uninstall applications you don\'t plan to use, visit the **[[ %s | Applications Application ]]**. You can also click the **Applications** button in the left navigation menu, or search for an application by name in the main menu bar.\n\n',

