	  // src/applications/config/option/PhabricatorCoreConfigOptions.php:151
	  'Phabricator occasionally shells out to other binaries on the server. An example of this is the `pygmentize` command, used to syntax-highlight code written in languages other than PHP. By default, it is assumed that these binaries are in the $PATH of the user running Phabricator (normally \'apache\', \'httpd\', or \'nobody\'). Here you can add extra directories to the $PATH environment variable, for when these binaries are in non-standard locations.\n\nNote that you can also put binaries in `phabricator/support/bin/` (for example, by symlinking them).\n\nThe current value of PATH after configuration is applied is:\n\n  lang=text\n  %s' => 'Phabricator occasionally shells out to other binaries on the server. An example of this is the `pygmentize` command, used to syntax-highlight code written in languages other than PHP. By default, it is assumed that these binaries are in the $PATH of the user running Phabricator (normally \'apache\', \'httpd\', or \'nobody\'). Here you can add extra directories to the $PATH environment variable, for when these binaries are in non-standard locations.\n\nNote that you can also put binaries in `phabricator/support/bin/` (for example, by symlinking them).\n\nThe current value of PATH after configuration is applied is:\n\n  lang=text\n  %s',

	  // src/applications/files/config/PhabricatorFilesConfigOptions.php:121
	  'Phabricator provides a local disk storage engine, which just writes files to some directory on local disk. The webserver must have read/write permissions on this directory. This is straightforward and suitable for most installs, but will not scale past one web frontend unless the path is actually an NFS mount, since you\'ll end up with some of the files written to each web frontend and no way for them to share. To use the local disk storage engine, specify the path to a directory here. To disable it, specify null.' => 'Phabricator provides a local disk storage engine, which just writes files to some directory on local disk. The webserver must have read/write permissions on this directory. This is straightforward and suitable for most installs, but will not scale past one web frontend unless the path is actually an NFS mount, since you\'ll end up with some of the files written to each web frontend and no way for them to share. To use the local disk storage engine, specify the path to a directory here. To disable it, specify null.',

	  // src/applications/config/option/PhabricatorMySQLConfigOptions.php:66
	  'Phabricator puts databases in a namespace, which defaults to \'phabricator\' -- for instance, the Differential database is named \'phabricator_differential\' by default. You can change this namespace if you want. Normally, you should not do this unless you are developing Phabricator and using namespaces to separate multiple sandbox datasets.' => 'Phabricator puts databases in a namespace, which defaults to \'phabricator\' -- for instance, the Differential database is named \'phabricator_differential\' by default. You can change this namespace if you want. Normally, you should not do this unless you are developing Phabricator and using namespaces to separate multiple sandbox datasets.',

