	  'Phabricator uses a storage engine selector to choose which storage engine to use when writing file data. If you add new storage engines or want to provide very custom rules (e.g., write images to one storage engine and other files to a different one), you can provide an alternate implementation here. The default engine will use choose MySQL, Local Disk, and S3, in that order, if they have valid configurations above and a file fits within configured limits.' => 'Phabricator uses a storage engine selector to choose which storage engine to use when writing file data. If you add new storage engines or want to provide very custom rules (e.g., write images to one storage engine and other files to a different one), you can provide an alternate implementation here. The default engine will use choose MySQL, Local Disk, and S3, in that order, if they have valid configurations above and a file fits within configured limits.',

