	  // src/applications/auth/provider/PhabricatorAsanaAuthProvider.php:14
	  'To configure Asana OAuth, create a new application here:\n\nhttps://app.asana.com/-/account_api\n\nWhen creating your application, use these settings:\n\n  - **App URL:** Set this to: `%s`\n  - **Redirect URL:** Set this to: `%s`\n\nAfter completing configuration, copy the **Client ID** and **Client Secret** to the fields above.' => 'To configure Asana OAuth, create a new application here:\n\nhttps://app.asana.com/-/account_api\n\nWhen creating your application, use these settings:\n\n  - **App URL:** Set this to: `%s`\n  - **Redirect URL:** Set this to: `%s`\n\nAfter completing configuration, copy the **Client ID** and **Client Secret** to the fields above.',

	  // src/applications/phortune/provider/PhortuneBalancedPaymentProvider.php:33
	  'To configure Balacned, register or log in to an existing account on [[https://balancedpayments.com | balancedpayments.com]]. Once logged in:\n\n  - Choose a marketplace.\n  - Find the **Marketplace ID** in {nav My Marketplace > Settings} and     copy it into the field above.\n  - On the same screen, under **API keys**, choose **Add a key**, then     **Show key secret**. Copy the value into the field above.\n\nYou can either use a test marketplace to add this provider in test mode, or use a live marketplace to accept live payments.' => 'To configure Balacned, register or log in to an existing account on [[https://balancedpayments.com | balancedpayments.com]]. Once logged in:\n\n  - Choose a marketplace.\n  - Find the **Marketplace ID** in {nav My Marketplace > Settings} and     copy it into the field above.\n  - On the same screen, under **API keys**, choose **Add a key**, then     **Show key secret**. Copy the value into the field above.\n\nYou can either use a test marketplace to add this provider in test mode, or use a live marketplace to accept live payments.',

	  // src/applications/auth/provider/PhabricatorBitbucketAuthProvider.php:12
	  'To configure Bitbucket OAuth, log in to Bitbucket and go to **Manage Account** > **Access Management** > **OAuth**.\n\nClick **Add Consumer** and create a new application.\n\nAfter completing configuration, copy the **Key** and **Secret** to the fields above.' => 'To configure Bitbucket OAuth, log in to Bitbucket and go to **Manage Account** > **Access Management** > **OAuth**.\n\nClick **Add Consumer** and create a new application.\n\nAfter completing configuration, copy the **Key** and **Secret** to the fields above.',

	  // src/applications/auth/provider/PhabricatorDisqusAuthProvider.php:14
	  'To configure Disqus OAuth, create a new application here:\n\nhttp://disqus.com/api/applications/\n\nCreate an application, then adjust these settings:\n\n  - **Callback URL:** Set this to `%s`\n\nAfter creating an application, copy the **Public Key** and **Secret Key** to the fields above (the **Public Key** goes in **OAuth App ID**).' => 'To configure Disqus OAuth, create a new application here:\n\nhttp://disqus.com/api/applications/\n\nCreate an application, then adjust these settings:\n\n  - **Callback URL:** Set this to `%s`\n\nAfter creating an application, copy the **Public Key** and **Secret Key** to the fields above (the **Public Key** goes in **OAuth App ID**).',

	  // src/applications/auth/provider/PhabricatorFacebookAuthProvider.php:15
	  'To configure Facebook OAuth, create a new Facebook Application here:\n\nhttps://developers.facebook.com/apps\n\nYou should use these settings in your application:\n\n  - **Site URL**: Set this to `%s`\n  - **Valid OAuth redirect URIs**: You should also set this to `%s`\n  - **Client OAuth Login**: Set this to **OFF**.\n  - **Embedded browser OAuth Login**: Set this to **OFF**.\n\n\nSome of these settings may be in the **Advanced** tab.\n\nAfter creating your new application, copy the **App ID** and **App Secret** to the fields above.' => 'To configure Facebook OAuth, create a new Facebook Application here:\n\nhttps://developers.facebook.com/apps\n\nYou should use these settings in your application:\n\n  - **Site URL**: Set this to `%s`\n  - **Valid OAuth redirect URIs**: You should also set this to `%s`\n  - **Client OAuth Login**: Set this to **OFF**.\n  - **Embedded browser OAuth Login**: Set this to **OFF**.\n\n\nSome of these settings may be in the **Advanced** tab.\n\nAfter creating your new application, copy the **App ID** and **App Secret** to the fields above.',

	  // src/applications/auth/provider/PhabricatorGitHubAuthProvider.php:15
	  'To configure GitHub OAuth, create a new GitHub Application here:\n\nhttps://github.com/settings/applications/new\n\nYou should use these settings in your application:\n\n  - **URL:** Set this to your full domain with protocol. For this     Phabricator install, the correct value is: `%s`\n  - **Callback URL**: Set this to: `%s`\n\n\nOnce you\'ve created an application, copy the **Client ID** and **Client Secret** into the fields above.' => 'To configure GitHub OAuth, create a new GitHub Application here:\n\nhttps://github.com/settings/applications/new\n\nYou should use these settings in your application:\n\n  - **URL:** Set this to your full domain with protocol. For this     Phabricator install, the correct value is: `%s`\n  - **Callback URL**: Set this to: `%s`\n\n\nOnce you\'ve 创建了 an application, copy the **Client ID** and **Client Secret** into the fields above.',

	  // src/applications/auth/provider/PhabricatorGoogleAuthProvider.php:14
	  'To configure Google OAuth, create a new \'API Project\' here:\n\nhttps://console.developers.google.com/\n\nAdjust these configuration settings for your project:\n\n  - Under **APIs & auth > APIs**, scroll down the list and enable     the **Google+ API**.\n     - You will need to consent to the **Google+ API** terms if you  have not before.\n  - Under **APIs & auth > Credentials**, click **Create New Client    ID** in the **OAuth** section. Then use these settings:\n     - **Application Type**: Web Application\n     - **Authorized Javascript origins**: Leave this empty.\n     - **Authorized redirect URI**: Set this to `%s`.\n\n\nAfter completing configuration, copy the **Client ID** and **Client Secret** from the Google console to the fields above.' => 'To configure Google OAuth, create a new \'API Project\' here:\n\nhttps://console.developers.google.com/\n\nAdjust these configuration settings for your project:\n\n  - Under **APIs & auth > APIs**, scroll down the list and enable     the **Google+ API**.\n     - You will need to consent to the **Google+ API** terms if you  have not before.\n  - Under **APIs & auth > Credentials**, click **Create New Client    ID** in the **OAuth** section. Then use these settings:\n     - **Application Type**: Web Application\n     - **Authorized Javascript origins**: Leave this empty.\n     - **Authorized redirect URI**: Set this to `%s`.\n\n\nAfter completing configuration, copy the **Client ID** and **Client Secret** from the Google console to the fields above.',

	  // src/applications/phortune/provider/PhortunePayPalPaymentProvider.php:36
	  'To configure PayPal, register or log into an existing account on [[https://paypal.com | paypal.com]] (for live payments) or [[https://sandbox.paypal.com | sandbox.paypal.com]] (for test payments). Once logged in:\n\n  - Navigate to {nav Tools > API Access}.\n  - Choose **View API Signature**.\n  - Copy the **API Username**, **API Password** and **Signature**     into the fields above.\n\nYou can select whether the provider operates in test mode or accepts live payments using the **Mode** dropdown above.\n\nYou can either use `sandbox.paypal.com` to retrieve live credentials, or `paypal.com` to retrieve live credentials.' => 'To configure PayPal, register or log into an existing account on [[https://paypal.com | paypal.com]] (for live payments) or [[https://sandbox.paypal.com | sandbox.paypal.com]] (for test payments). Once logged in:\n\n  - Navigate to {nav Tools > API Access}.\n  - Choose **View API Signature**.\n  - Copy the **API Username**, **API Password** and **Signature**     into the fields above.\n\nYou can select whether the provider operates in test mode or accepts live payments using the **Mode** dropdown above.\n\nYou can either use `sandbox.paypal.com` to retrieve live credentials, or `paypal.com` to retrieve live credentials.',

	  // src/applications/phortune/provider/PhortuneStripePaymentProvider.php:104
	  'To configure Stripe, register or log in to an existing account on [[https://stripe.com | stripe.com]]. Once logged in:\n\n  - Go to {nav icon=user, name=Your Account > Account Settings > API Keys}\n  - Copy the **Secret Key** and **Publishable Key** into the fields above.\n\nYou can either use the test keys to add this provider in test mode, or the live keys to accept live payments.' => 'To configure Stripe, register or log in to an existing account on [[https://stripe.com | stripe.com]]. Once logged in:\n\n  - Go to {nav icon=user, name=Your Account > Account Settings > API Keys}\n  - Copy the **Secret Key** and **Publishable Key** into the fields above.\n\nYou can either use the test keys to add this provider in test mode, or the live keys to accept live payments.',

	  // src/applications/auth/provider/PhabricatorTwitchAuthProvider.php:14
