	  // src/applications/config/check/PhabricatorSetupCheckStorage.php:37
	  'When you upload a file via drag-and-drop or the API, the entire file is buffered into memory before being written to permanent storage. Phabricator needs memory available to store these files while they are uploaded, but PHP is currently configured to limit the available memory.\n\nYour Phabricator %s is currently set to a larger value (%s) than the amount of available memory (%s) that a PHP process has available to use, so uploads via drag-and-drop and the API will hit the memory limit before they hit other limits.\n\n(Note that the application itself must also fit in available memory, so not all of the memory under the memory limit is available for buffering file uploads.)\n\nThe easiest way to resolve this issue is to set %s to %s in your PHP configuration, to disable the memory limit. There is usually little or no value to using this option to limit Phabricator process memory.\n\nYou can also increase the limit, or decrease %s, or ignore this issue and accept that these upload mechanisms will be limited in the size of files they can handle.' => 'When you upload a file via drag-and-drop or the API, the entire file is buffered into memory before being written to permanent storage. Phabricator needs memory available to store these files while they are uploaded, but PHP is currently configured to limit the available memory.\n\nYour Phabricator %s is currently set to a larger value (%s) than the amount of available memory (%s) that a PHP process has available to use, so uploads via drag-and-drop and the API will hit the memory limit before they hit other limits.\n\n(Note that the application itself must also fit in available memory, so not all of the memory under the memory limit is available for buffering file uploads.)\n\nThe easiest way to resolve this issue is to set %s to %s in your PHP configuration, to disable the memory limit. There is usually little or no value to using this option to limit Phabricator process memory.\n\nYou can also increase the limit, or decrease %s, or ignore this issue and accept that these upload mechanisms will be limited in the size of files they can handle.',

	  // src/applications/config/controller/PhabricatorConfigWelcomeController.php:174
	  'When you\'re done setting things up, you can create a custom dashboard and install it. Your dashboard will replace this welcome screen on the Phabricator home page.\n\nDashboards can show users the information that\'s most important to your organization. You can configure them to display things like: a custom welcome message, a feed of recent activity, or a list of open tasks, waiting reviews, recent commits, and so on.\n\nAfter you install a default dashboard, it will replace this page. You can find this page later by visiting the **Config** application, under **Welcome Page**.\n\nTo get started building a dashboard, use the **[[ %s | Dashboards Application ]]**.\n\n' => 'When you\'re done setting things up, you can create a custom dashboard and install it. Your dashboard will replace this welcome screen on the Phabricator home page.\n\nDashboards can show users the information that\'s most important to your organization. You can configure them to display things like: a custom welcome message, a feed of recent activity, or a list of open tasks, waiting reviews, recent commits, and so on.\n\nAfter you install a default dashboard, it will replace this page. You can find this page later by visiting the **Config** application, under **Welcome Page**.\n\nTo get started building a dashboard, use the **[[ %s | Dashboards Application ]]**.\n\n',

